import React, { useState, useRef, useEffect } from 'react';
import './App.css';

// Predefined kernels
const kernels = {
  identity: {
    name: "Identity",
    matrix: [
      [0, 0, 0],
      [0, 1, 0],
      [0, 0, 0],
    ],
  },
  edge: {
    name: "Edge Detection",
    matrix: [
      [-1, -1, -1],
      [-1, 8, -1],
      [-1, -1, -1],
    ],
  },
  sharpen: {
    name: "Sharpen",
    matrix: [
      [0, -1, 0],
      [-1, 5, -1],
      [0, -1, 0],
    ],
  },
  boxBlur: {
    name: "Box Blur",
    matrix: [
      [1 / 9, 1 / 9, 1 / 9],
      [1 / 9, 1 / 9, 1 / 9],
      [1 / 9, 1 / 9, 1 / 9],
    ],
  },
};

function App() {
  const [image, setImage] = useState(null);
  const [kernel, setKernel] = useState(kernels.identity);
  const [outputData, setOutputData] = useState(null);
  const [highlightRegion, setHighlightRegion] = useState(null);
  const inputCanvasRef = useRef(null);
  const outputCanvasRef = useRef(null);

  const applyKernel = () => {
    const inputCanvas = inputCanvasRef.current;
    const outputCanvas = outputCanvasRef.current;
    const ctxIn = inputCanvas.getContext("2d");
    const ctxOut = outputCanvas.getContext("2d");

    const { width, height } = inputCanvas;
    const inputData = ctxIn.getImageData(0, 0, width, height);
    const output = ctxOut.createImageData(width, height);

    const getPixel = (x, y, c) => {
      if (x < 0 || x >= width || y < 0 || y >= height) return 0;
      return inputData.data[(y * width + x) * 4 + c];
    };

    for (let y = 1; y < height - 1; y++) {
      for (let x = 1; x < width - 1; x++) {
        let r = 0, g = 0, b = 0;
        for (let ky = -1; ky <= 1; ky++) {
          for (let kx = -1; kx <= 1; kx++) {
            const weight = kernel.matrix[ky + 1][kx + 1];
            r += getPixel(x + kx, y + ky, 0) * weight;
            g += getPixel(x + kx, y + ky, 1) * weight;
            b += getPixel(x + kx, y + ky, 2) * weight;
          }
        }
        const idx = (y * width + x) * 4;
        output.data[idx] = Math.min(255, Math.max(0, r));
        output.data[idx + 1] = Math.min(255, Math.max(0, g));
        output.data[idx + 2] = Math.min(255, Math.max(0, b));
        output.data[idx + 3] = 255;
      }
    }

    ctxOut.putImageData(output, 0, 0);
    setOutputData(output);
  };

  const handleImageUpload = (e) => {
    const img = new Image();
    img.onload = () => {
      const canvas = inputCanvasRef.current;
      canvas.width = img.width;
      canvas.height = img.height;
      outputCanvasRef.current.width = img.width;
      outputCanvasRef.current.height = img.height;

      const ctx = canvas.getContext("2d");
      ctx.drawImage(img, 0, 0);
      applyKernel();
    };
    img.src = URL.createObjectURL(e.target.files[0]);
    setImage(img);
  };

  const handleCanvasClick = (e) => {
    const rect = inputCanvasRef.current.getBoundingClientRect();
    const x = Math.floor(e.clientX - rect.left);
    const y = Math.floor(e.clientY - rect.top);
    setHighlightRegion({ x, y });
  };

  return (
    <div className="App">
      <h1>CNN Feature Visualization</h1>
      <div className="controls">
        <input type="file" accept="image/*" onChange={handleImageUpload} />
        <select onChange={(e) => setKernel(kernels[e.target.value])}>
          {Object.entries(kernels).map(([key, val]) => (
            <option key={key} value={key}>
              {val.name}
            </option>
          ))}
        </select>
      </div>

      <div className="canvas-container">
        <div>
          <h2>Input Image</h2>
          <canvas
            ref={inputCanvasRef}
            onClick={handleCanvasClick}
            className="canvas"
          />
        </div>
        <div>
          <h2>Output Image</h2>
          <canvas
            ref={outputCanvasRef}
            className="canvas"
            style={{
              outline: highlightRegion
                ? `2px dashed red`
                : "2px solid transparent",
            }}
          />
        </div>
      </div>

      {highlightRegion && (
        <div className="overlay">
          <h3>Selected 10×10 Patch: ({highlightRegion.x}, {highlightRegion.y})</h3>
          <p>
            This 10×10 input region contributes to a **corresponding region** in
            the output (centered around the clicked pixel).
          </p>
        </div>
      )}
    </div>
  );
}

export default App;
